relationships:
  - name: questions
    label: Questions
    type: one_to_many
    self:
      key: id
    target:
      name: etExamAttemptQuestions
      key: attemptId
  - name: templateExam
    label: Template Exam
    type: many_to_one
    self:
      key: templateExamId
    target:
      name: etCourseTemplateExams
      key: id
      label: name
